    List,
    InputItem,
    WhiteSpace,
    Radio,
    Button
} from 'antd-mobile'
import Logo from '../../components/logo/logo'
export default class Register extends Component{
    constructor(props){
        super(props);
        this.state={
            username:'',
            password:'',
            password2:'',
            type:'employee'
        }
        this.handleChange = this.handleChange.bind(this);
    }

    handleChange=(name,value)=>{
        this.setState({
            [name]:value
        })
    }

    toLogin=()=>{
        this.props.history.replace('/login');
    }

    render(){
        const {type} = this.state;
        return(
            <div>
                <NavBar>Hiring management</NavBar>
                <Logo />
                <WingBlank>
                    <List>
                        <InputItem placeholder="Please input username" onChange={this.handleChange}>
                            Username:
                        </InputItem>
                        <WhiteSpace />
                        <InputItem>

                        </InputItem>
                    </List>
                </WingBlank>
                <div>Register</div>
            </div>
        )
    }
}
